import { Component } from "@angular/core";

@Component({
  standalone: true,
  selector: "app-root",
  template: ` <main>
    <header class="brand-name">
      <img src="..assets/logo.svg" alt="" class="brand-logo" />
    </header>
  </main>`,
  styleUrls: ["./app.component.css"],
})
export class AppComponent {
  title = "homes";
}
